import React, { Component } from 'react';
import { Form, Col } from 'react-bootstrap';

class BondPricingOne extends Component {
    state = {}
    render() {
        return (
            <div style={{ width: '75%', margin: 'auto' }}>
                <Form>
                    <Form.Row>
                        <Col>
                            <Form.Label>Series</Form.Label>
                            <Form.Control as="select" size="sm" custom>
                                <option>EE Bond</option>
                                <option>I Bond</option>
                                <option>E Bond</option>
                                <option>Savings Note</option>
                            </Form.Control>
                            <Form.Label>Serial Number (Optional)</Form.Label>
                            <Form.Control
                                required
                                type="text"
                                placeholder="L123456789"
                            />
                        </Col>
                    </Form.Row>
                </Form>
            </div>
        )
    }
}

export default BondPricingOne;
